import ProductCard from '../components/ProductCard';

function Catalog({
  products,
  cart,
  favorites,
  addToCart,
  addToFavorites,
}) {
  return (
    <div>
      <h2>Catalog</h2>

      <div style={styles.grid}>
        {products.map(product => (
          <ProductCard
            key={product.id}
            product={product}
            cart={cart}ф
            favorites={favorites}
            addToCart={addToCart}
            addToFavorites={addToFavorites}
          />
        ))}
      </div>
    </div>
  );
}

const styles = {
  grid: {
    display: 'flex',
    flexWrap: 'wrap',
    gap: '16px',
  },
};

export default Catalog;
